import React, { useState, useCallback } from 'react';
import { Form, List, Button, Input} from 'antd';
import styled from 'styled-components';

const CenterDiv = styled.div`
    width: 70%;
    margin : 0 auto;
    margin-top: 20px;
`;

const CustomBtn = styled(Button)`
    margin-bottom: 5px;
`;
const CustomItem = styled(List.Item)`
    margin: 0;
    justify-content: center;
    padding: 0;CustomBtn
`;

const data = [{
    id: 1,
    content: '살 70Kg 만들기'
}, {
    id: 2,
    content: '돈 500만원 모으기'
}, {
    id: 3,
    content: '돈 500만원 모으기'
}];

const EditUser = () => { 
    return (
        <Form>
            <CenterDiv>
                <CustomBtn>추가</CustomBtn>
                <CustomBtn style={{float: 'right'}}>삭제</CustomBtn>
                <Input placeholder={'추가 또는 삭제하고싶은 버킷리스트를 입력하세요'} />
                <List
                style={{overflow: 'hidden'}}
                size="small"
                bordered
                dataSource={data}
                renderItem={item => <CustomItem>{item.content}</CustomItem>}
                />
            </CenterDiv>
        </Form>
    );
}

export default EditUser;
